import React from 'react';
import PropTypes from 'prop-types';
import { Highlight } from 'react-instantsearch-dom';

export const Hit = ({ hit }) => {
  return (
    <article>
      <div className="hit-domain">
			  <Highlight attribute="domain" hit={hit} />
        <Highlight attribute="Company All Available Names" hit={hit} /> <br />
        <Highlight attribute="Company Comercial Names" hit={hit} /> <br />
        <Highlight attribute="Company Legal Names" hit={hit} /> <br />
        <Highlight attribute="addresses" hit={hit} /> <br />
        <Highlight attribute="facebook_links" hit={hit} />  <br />
        <Highlight attribute="phone_numbers" hit={hit} /> <br />
			</div>
    </article>
  );
};

Hit.propTypes = {
  hit: PropTypes.object.isRequired, 
};
